B.yd=new A.d2("assets/images/game_hobby.jpeg","In my free time, I enjoy immersing myself in virtual worlds, exploring new stories and experiencing new challenges.\nTechnology offers me the opportunity to test myself in ever new and stimulating contexts.\nI don't just play familiar titles, but I'm always looking for new experiences and challenges.\nI love discovering innovative and original games that make me think critically and develop new skills.\nMy passion for video games is not just for fun, but also a way to train my mind and broaden my horizons.",B.as,B.fN)
