B.yh=new A.d2(u._,"Ol\xe1, meu nome \xe9 Edoardo Fabrizio De Iovanna, desenvolvedor com ra\xedzes italo-brasileiras.\nNasci em Mil\xe3o, It\xe1lia, e, quando crian\xe7a, me mudei para Olgiate Comasco.\nAos 10 anos, minha fam\xedlia se mudou para o Brasil, fixando-se em Taiobeiras, Minas Gerais.\nAos 13 anos, fui para Aracaju, Sergipe, onde conclu\xed o ensino m\xe9dio e iniciei minha gradua\xe7\xe3o em Sistemas de Informa\xe7\xe3o.\nDurante os estudos, descobri minha paix\xe3o pelo desenvolvimento mobile, explorando linguagens como C++, C# e Java.\nEm 2020, retornei a Taiobeiras e me especializei em Flutter, um framework que utilizo para criar experi\xeancias inovadoras multiplataforma.\nAtualmente, estou em busca de oportunidades para crescer profissionalmente e contribuir para projetos tecnol\xf3gicos ambiciosos.",B.hl,B.fO)
B.yc=new A.d2("assets/images/certificates.png","A obten\xe7\xe3o de certifica\xe7\xf5es representa um ponto fundamental do meu percurso profissional e da minha dedica\xe7\xe3o \xe0 aprendizagem cont\xednua.\nParticipei de cursos e workshops sobre linguagens de programa\xe7\xe3o e metodologias \xe1geis.\nIsso inclui certifica\xe7\xf5es em C#, Java, Python, Flutter e Unreal Engine, bem como ferramentas avan\xe7adas de desenvolvimento.\nCada certificado reflete meu compromisso em traduzir a teoria em pr\xe1tica, ressaltando meu desejo de me destacar no fornecimento de solu\xe7\xf5es de software de alta qualidade.",B.as,B.fS)
B.ym=new A.d2("assets/images/work.png","Durante os meus estudos, desenvolvi alguns projetos pessoais que me permitam aprofundar minhas habilidades em desenvolvimento mobile.\nAbaixo est\xe3o dois dos meus principais projetos:\n\nBooks Catalog:\n\u2726 Um aplicativo Android nativo para gerenciar e organizar livros, desenvolvido utilizando Java e Android Studio.\nBookify:\n\u2726 Um aplicativo Flutter para descobrir e catalogar livros, projetado para oferecer uma experi\xeancia fluida em diversas plataformas.\n\nAmbos os dois projetos podem ser encontrados no meu GitHub.",B.as,B.fM)
B.yj=new A.d2("assets/images/game_hobby.jpeg","No meu tempo livre gosto de mergulhar em mundos virtuais, explorar novas hist\xf3rias e experimentar novos desafios.\n A tecnologia me oferece a oportunidade de me testar em contextos sempre novos e estimulantes.\n N\xe3o jogo apenas t\xedtulos conhecidos, mas estou sempre em busca de novas experi\xeancias e desafios.\nAdoro descobrir jogos inovadores e originais que me levem a pensar criticamente e a desenvolver novas habilidades.\nMinha paix\xe3o por videogames n\xe3o se limita apenas \xe0 divers\xe3o, mas tamb\xe9m representa uma forma de treinar minha mente e ampliar meus horizontes.",B.as,B.fN)
B.yi=new A.d2("assets/images/music_hobby.jpeg","Al\xe9m das atividades j\xe1 mencionadas, a m\xfasica ocupa um lugar especial na minha vida.\n        Em particular, Gosto de tocar flauta doce, um instrumento que considero relaxante e vers\xe1til al\xe9m do som suave e delicado.\n        Gosto do desafio de aprender novas m\xfasicas e melhorar minhas habilidades.",B.as,null)
