B.yg=new A.d2(u._,"Ciao, mi chiamo Edoardo Fabrizio De Iovanna, sviluppatore con radici italo-brasiliane.\nSono nato a Milano, in Italia, e da bambino mi sono trasferito a Olgiate Comasco.\nAll'et\xe0 di 10 anni, la mia famiglia si trasfer\xec in Brasile, stabilendosi a Taiobeiras, Minas Gerais.\nAll'et\xe0 di 13 anni sono andato ad Aracaju, Sergipe, dove ho finito il liceo e ho iniziato la mia laurea in Sistemi Informativi.\nDurante i miei studi ho scoperto la mia passione per lo sviluppo mobile, esplorando linguaggi come C++, C# e Java.\nNel 2020 sono tornato a Taiobeiras e mi sono specializzato in Flutter, un framework che utilizzo per creare esperienze multipiattaforma innovative.\nAttualmente sono alla ricerca di opportunit\xe0 per crescere professionalmente e contribuire ad ambiziosi progetti tecnologici.",B.hl,B.fO)
B.yb=new A.d2("assets/images/certificates.png","Ottenere certificazioni rappresenta un punto fondamentale del mio percorso professionale e della mia dedizione all'apprendimento continuo.\nHo partecipato a corsi e workshop su linguaggi di programmazione e metodologie agili. \nQuesti includono certificazioni in C#, Java, Python, Flutter e Unreal Engine, oltre a strumenti avanzati per lo sviluppo. \nOgni certificato riflette il mio impegno a tradurre la teoria in pratica, sottolineando il mio desiderio di eccellere nel fornire soluzioni software di alta qualit\xe0.",B.as,B.fS)
B.yl=new A.d2("assets/images/work.png","Durante i miei studi ho sviluppato alcuni progetti personali che mi hanno permesso di approfondire le mie capacit\xe0 di sviluppo mobile.\nDi seguito sono riportati due dei miei progetti principali:\n\nCatalogo libri:\n\u2726 Un'applicazione Android nativa per la gestione e l'organizzazione dei libri, sviluppata utilizzando Java e Android Studio.\nPrenota:\n\u2726 Un'app Flutter per scoprire e catalogare libri, progettata per offrire un'esperienza fluida su pi\xf9 piattaforme.\n\nEntrambi i progetti possono essere trovati sul mio GitHub.",B.as,B.fM)
B.y9=new A.d2("assets/images/game_hobby.jpeg","Nel tempo libero mi piace immergermi nei mondi virtuali, esplorare nuove storie e provare nuove sfide.\n La tecnologia mi offre l'opportunit\xe0 di mettermi alla prova in contesti sempre nuovi e stimolanti.\n Non gioco solo a titoli conosciuti, ma sono sempre alla ricerca di nuove esperienze e sfide.\nAmo scoprire giochi innovativi e originali che mi incoraggiano a pensare in modo critico e a sviluppare nuove competenze.\nLa mia passione per i videogiochi non si limita solo al divertimento, ma rappresenta anche un modo per allenare la mia mente e ampliare i miei orizzonti.",B.as,B.fN)
B.yn=new A.d2("assets/images/music_hobby.jpeg","Oltre alle attivit\xe0 gi\xe0 citate, la musica occupa un posto speciale nella mia vita.\n In particolare mi piace suonare il flauto dolce, uno strumento che trovo rilassante e versatile oltre al suo suono morbido e delicato.\n Mi piace la sfida di imparare nuova musica e migliorare le mie capacit\xe0.",B.as,null)
